import '../css/app.css'
import {useState} from 'react'
import LogIn from './login'
import Dashboard from './dashboard'
import { ContactsProvider, useContacts } from '../contexts/contactsprovider'




function App() {
  const [ID,setID] =useState()
  const dashboard = (
    <ContactsProvider>
      <Dashboard id={ID}/>
    </ContactsProvider>
  )



  return (
    <div className="App">

       { sessionStorage['id'] ? <Dashboard id={ID}/>:<LogIn GetLoginID={setID}/>}
    </div>
  );
}

export default App;
